INSERT INTO `transaction_status` VALUES (1,'SBM','Submitted','The transaction is pending in internet banking.  It has not yet been received by the banking system.'),(2,'SPE','Submitted Pending Execution','The transaction is pending for execution in the banking system.'),(3,'ACP','Accepted','The transaction has been received and will be processed manually.'),(4,'PAP','Pending Approval','The transaction is pending for approval from other User(s) - applicable only for accounts with multiple signatures.'),(5,'CMP','Completed','The transaction has been completed successfully.'),(6,'PFE','Pending Future Execution','The transaction is pending to be executed on the date entered.'),(7,'DCL','Declined by User','The transaction has been declined by a User - available only if a transaction is in status Pending (Future Execution) or Pending Approval.'),(8,'RJC','Rejected by System','The transaction has been rejected by the banking system. '),(9,'FLD','Failed','The transaction failed to be executed due to an abnormal error such as system failure, future transactions that fail to be executed due to unavailability of funds.'),(10,'EXP','Expired','The transaction has expired because not all required users have approved it by the end of its execution date.');
