CREATE DEFINER=`root`@`localhost` PROCEDURE `initialize_user`(
IN 
email VARCHAR(45),
password VARCHAR(60),
name VARCHAR(45),
surname VARCHAR(45),
number VARCHAR(45),
address VARCHAR(45),
hnumber SMALLINT(10),
verificationCode VARCHAR(60)
)
BEGIN
DECLARE currentTimestampI DATETIME;
DECLARE expiryDateI DATETIME;
DECLARE EXIT HANDLER FOR SQLEXCEPTION
 BEGIN
	GET DIAGNOSTICS CONDITION 1
    @p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
	-- SELECT @p1 AS "SQL_STATE", @p2 AS "MESSAGE";
    
    IF (@p1 <=> '23000' && INSTR(@p2,'EMAIL_UNIQUE')!=0) THEN
		SELECT CONCAT(@p1,'_EMAIL') AS "SQL_STATE", "Duplicate email!" AS "MESSAGE";
    ELSE 
		SELECT CONCAT(@p1,'_INTER') AS "SQL_STATE", "Internal database error!" AS "MESSAGE";
        -- SELECT CONCAT(@p1,'_INTER') AS "SQL_STATE", @p2 AS "MESSAGE";
    END IF;
	
    -- If any error occurs, rollback database
    ROLLBACK;
 END;

SET currentTimestampI = CURRENT_TIMESTAMP();
SET expiryDateI = ADDDATE(currentTimestampI,365);

-- 1. Start a new transaction
START TRANSACTION;

-- 2. Insert a new account
INSERT INTO account
 (
 currentBalance,
 garnishment,
 currencyID,
 dateOpened,
 dateClosed,
 userID
 )
VALUES
 (
ROUND(RAND()*100000),
"0",
"1",
currentTimestampI,
NULL,
"2"
 );

-- 3. Save the last inesrted accountID
SET @lastAccountID:=LAST_INSERT_ID();

-- 4. Insert a new user
INSERT INTO user
 (
  email,
  password,
  name,
  surname,
  number,
  address,
  hnumber,
  dateRegistered,
  defaultAccountID,
  verificationCode
 )
VALUES
 (
  email,
  password,
  name,
  surname,
  number,
  address,
  hnumber,
  currentTImestampI,
  "183",
  verificationCode
 );

-- 5. Save the last inesrted userID
SET @lastUserID:=LAST_INSERT_ID();

-- 6. Insert a new card
INSERT INTO card
 (
  typeID,
  nameID,
  creationDate,
  expiryDate,
  statusID,
  userID
 )
VALUES
 (
  "2",
  "1",
  currentTImestampI,
  expiryDateI,
  "1",
  "2"
 );

-- 7. Save the last inesrted cardID
SET @lastCardID:=LAST_INSERT_ID();

-- 8. Update userID in account
UPDATE account
SET userID = @lastUserID
WHERE accountID = @lastAccountID;

-- 9. Update accountID in user
UPDATE user
SET defaultAccountID = @lastAccountID
WHERE userID = @lastUserID;

-- 10. Update userID in card
UPDATE card
SET userID = @lastUserID
WHERE cardID = @lastCardID;

-- 11. Update accountID in card
UPDATE card
SET accountID = @lastAccountID
WHERE cardID = @lastCardID;

-- 12. Commit changes
COMMIT;

SELECT "369_OK" AS "SQL_STATE", "OK" AS "MESSAGE";
END ;;
